Defendant Jasmine E Valdez in court, in custody, with attorney Nicole M Masnica.   Melissa Zilavy appeared for the State of Wisconsin. Defendant enters a guilty plea as to counts 1 and 3, counts 2, 4, 5 and 6 are dismissed and read-in. Court  imposed the following sentence: 

  The Defendant was given the following:  AS TO EACH COUNT, CONCURRENT 

WITHHELD SENTENCE;

TERM OF PROBATION:  2 YEAR(S);

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*No Use or Possession controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions
*Follow through with any treatment and/or counseling recommended by Agent;
*No operation of motor vehicle unless she has valid driver's license
*DNA sample to be provided if not yet previously done.

COURT COSTS:  $268.00 (ct. 1) and $243.00 (ct. 3) (to be paid as a condition of probation);

DNA SURCHARGE:  $250.00  (ct. 1)  (to be paid as a condition of probation);

CONDITION TIME: 45 days county jail, STAYED; to be used at agent's discretion.  Agent to determine with or without non working hours.  IF REVOKED 22 days credit.

Felony warnings, voting rights and firearms warnings given.

Expungement request is denied.
